apiVersion: v1
clusters:
- cluster:
    certificate-authority-data: 
    server: https://1F59EA7618FD6255CC228210C628BB1C.gr7.us-west-2.eks.amazonaws.com
  name: my-cluster.us-west-2.eksctl.io
contexts:
- context:
    cluster: my-cluster.us-west-2.eksctl.io
    user: iam-root-account@my-cluster.us-west-2.eksctl.io
  name: iam-root-account@my-cluster.us-west-2.eksctl.io
current-context: iam-root-account@my-cluster.us-west-2.eksctl.io
kind: Config
preferences: {}
users:
- name: iam-root-account@my-cluster.us-west-2.eksctl.io
  user:
    exec:
      apiVersion: client.authentication.k8s.io/v1beta1
      args:
      - token
      - -i
      - my-cluster
      command: aws-iam-authenticator
      env:
      - name: AWS_STS_REGIONAL_ENDPOINTS
        value: regional
      - name: AWS_DEFAULT_REGION
        value: us-west-2
      interactiveMode: IfAvailable
      provideClusterInfo: false
